syntax = "proto3";

import "CardLinkInfo.proto";

message DataRes {
    uint32 url_type = 1;
    int32 status = 2;
    string image = 3;
    string link_from = 4;
    string title = 5;
    string price_txt = 6;
    uint32 is_recognize = 7;
    string description = 8;
    CardLinkInfo card_link_info = 9;
}
